import React from 'react'

import SideBar from './components/Sidebar';
import Navigation from './components/Navigation';
import CreateDepart from './containers/Department/CreateDepart';
import CreateUsers from 'containers/Users/CreateUsers';
import './assets/styles/basic.scss';
import { BrowserRouter as Router, Switch, Route} from 'react-router-dom'
import './assets/icons/style.css'


export default function App() {
    return (
        <div>
            <Router>
                <Navigation/>
                <div className="d-flex flex-row">
                    <SideBar/>
                    <Route path="/createusers" component={CreateUsers}/>
                    <Route path="/createdepart" component={CreateDepart}/>
                </div>
            </Router>
        </div>
    )
}
